DROP TABLE IF EXISTS `tact_ru_task`;
CREATE TABLE `tact_ru_task` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `rev` int(10) DEFAULT NULL COMMENT 'rev',
  `execution_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'executionId',
  `proc_inst_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'procInstId',
  `proc_def_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'procDefId',
  `task_def_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'taskDefId',
  `scope_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'scopeId',
  `sub_scope_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'subScopeId',
  `scope_type` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'scopeType',
  `scope_definition_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'scopeDefinitionId',
  `name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '当前步骤',
  `parent_task_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'parentTaskId',
  `description` text COLLATE utf8_bin COMMENT '审批意见',
  `task_def_key` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'taskDefKey',
  `owner` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '任务描述',
  `assignee` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '流程名称',
  `delegation` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '申请理由',
  `priority` int(10) DEFAULT NULL COMMENT 'priority',
  `due_date` datetime DEFAULT NULL COMMENT 'dueDate',
  `category` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '流程名称',
  `suspension_state` int(10) DEFAULT NULL COMMENT 'suspensionState',
  `tenant_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'tenantId',
  `form_key` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'formKey',
  `claim_time` datetime DEFAULT NULL COMMENT 'claimTime',
  `is_count_enabled` int(3) DEFAULT NULL COMMENT 'isCountEnabled',
  `var_count` int(10) DEFAULT NULL COMMENT 'varCount',
  `id_link_count` int(10) DEFAULT NULL COMMENT 'idLinkCount',
  `sub_task_count` int(10) DEFAULT NULL COMMENT 'subTaskCount',
  `create_by` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '申请人',
  `create_time` datetime DEFAULT NULL COMMENT '申请时间',
  `update_by` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '审核人',
  `update_time` datetime DEFAULT NULL COMMENT '审核时间',
  `is_agree` varchar(1) COLLATE utf8_bin DEFAULT '1' COMMENT '是否同意',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

