-- ----------------------------
--  Table structure for `tb_edu_athlete_coach_evaluation`
-- ----------------------------
DROP TABLE IF EXISTS `tb_edu_athlete_coach_evaluation`;
CREATE TABLE `tb_edu_athlete_coach_evaluation` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `athlete_sport_class_id` varchar(32) NOT NULL COMMENT '训练队成员',
  `athlete_id` varchar(32) DEFAULT NULL,
  `evaluator` varchar(32) DEFAULT NULL COMMENT '评价教练',
  `start_date` datetime DEFAULT NULL COMMENT '开始日期',
  `end_date` datetime DEFAULT NULL COMMENT '结束日期',
  `evaluation` varchar(512) DEFAULT NULL COMMENT '总体评价',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='运动员评价信息表 ';

