-- ----------------------------
--  Table structure for `tb_edu_athlete_contest`
-- ----------------------------
DROP TABLE IF EXISTS `tb_edu_athlete_contest`;
CREATE TABLE `tb_edu_athlete_contest` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `athlete_id` varchar(32) NOT NULL COMMENT '运动员',
  `coach_id` varchar(32) NOT NULL COMMENT '教练员',
  `contest_name` varchar(128) DEFAULT NULL COMMENT '比赛名称',
  `contest_date` datetime DEFAULT NULL COMMENT '比赛日期',
  `contest_address` varchar(256) DEFAULT NULL COMMENT '比赛地点',
  `contest_sport_code` varchar(32) DEFAULT NULL COMMENT '比赛项目',
  `contest_event` varchar(128) DEFAULT NULL COMMENT '比赛小项',
  `contest_result` varchar(32) DEFAULT NULL COMMENT '名次',
  `athlete_department` varchar(128) DEFAULT NULL COMMENT '所在单位',
  `awarded_tech_grade` varchar(32) DEFAULT NULL COMMENT '授予技术等级',
  `awarded_department` varchar(128) DEFAULT NULL COMMENT '授予单位',
  `awarded_date` datetime DEFAULT NULL COMMENT '授予日期',
  `athlete_news` text COMMENT '个人风采',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='运动员参赛信息表 ';

