-- ----------------------------
--  Table structure for `tb_edu_cms_news`
-- ----------------------------
DROP TABLE IF EXISTS `tb_edu_cms_news`;
CREATE TABLE `tb_edu_cms_news` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `news_cat` varchar(32) NOT NULL DEFAULT '' COMMENT '新闻类别',
  `news_title` varchar(128) NOT NULL DEFAULT '' COMMENT '标题',
  `news_sub_title` varchar(128) NOT NULL DEFAULT '' COMMENT '副标题',
  `top_status` varchar(32) NOT NULL DEFAULT '' COMMENT '置顶状态',
  `news_order` int(11) DEFAULT NULL COMMENT '显示顺序',
  `enable_status` varchar(32) NOT NULL DEFAULT '' COMMENT '启用状态',
  `news_from` varchar(128) NOT NULL DEFAULT '' COMMENT '来源',
  `publish_date` datetime DEFAULT NULL COMMENT '报道时间',
  `title_image` varchar(256) NOT NULL DEFAULT '' COMMENT '标题图片',
  `news_summary` varchar(512) NOT NULL DEFAULT '' COMMENT '摘要',
  `news_content` text COMMENT '内容',
  `news_link` varchar(256) DEFAULT NULL COMMENT '链接地址',
  `news_hits` int(11) DEFAULT NULL COMMENT '阅览次数',
  `create_by` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) NOT NULL DEFAULT '' COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='公告消息表 ';

-- ----------------------------
--  Records of `tb_edu_cms_news`
-- ----------------------------
BEGIN;
INSERT INTO `tb_edu_cms_news` VALUES ('1239235121241137154', '1', '喜报（20190815）', '第二届青年运动会江西代表队潘佳乐喜获冠军', '', '1', '1', '', '2020-03-16 00:00:00', '', '', '<p style=\"margin: 0px auto; padding: 0px; list-style: none; color: #333333; font-family: 宋体; font-size: 14px; background-color: #ffffff;\">&nbsp;&nbsp;<span style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 16px; font-family: 宋体, SimSun;\">在2019年8月15日举行的中华人民共和国第二届青年运动会江西代表队潘佳乐获柔道俱乐部甲组男子-90公斤级冠军！</span></p>\n<p style=\"margin: 0px auto; padding: 0px; list-style: none; color: #333333; font-family: 宋体; font-size: 14px; background-color: #ffffff;\"><span style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 16px; font-family: 宋体, SimSun;\"><img style=\"margin: 0px auto; padding: 0px; list-style: none; border: none; max-width: 95%;\" src=\"http://www.jxstyxx.com/UploadFiles/2019-08/2/2019081521244595289.jpg\" border=\"0\" /></span></p>', null, null, 'jeecg', '2020-03-16 00:00:00', 'jeecg', '2020-06-08 17:44:03');
COMMIT;

-- ----------------------------
--  Table structure for `tb_edu_coach`
-- ----------------------------
DROP TABLE IF EXISTS `tb_edu_coach`;
CREATE TABLE `tb_edu_coach` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `coach_no` varchar(32) NOT NULL DEFAULT '' COMMENT '教练员代码',
  `coach_name` varchar(32) NOT NULL DEFAULT '' COMMENT '姓名',
  `gender` varchar(32) DEFAULT '' COMMENT '性别',
  `nation` varchar(32) DEFAULT '' COMMENT '民族',
  `birth_date` datetime DEFAULT NULL COMMENT '出生日期',
  `id_no` varchar(32) DEFAULT '' COMMENT '身份证号',
  `native_province` varchar(32) DEFAULT '' COMMENT '籍贯省',
  `native_city` varchar(32) DEFAULT '' COMMENT '籍贯市',
  `political_status` varchar(32) DEFAULT '' COMMENT '政治面貌',
  `home_address` varchar(256) DEFAULT '' COMMENT '家庭地址',
  `mobile` varchar(32) DEFAULT '' COMMENT '手机号码',
  `edu_background` varchar(32) DEFAULT NULL COMMENT '学历',
  `edu_degree` varchar(32) DEFAULT NULL COMMENT '学位',
  `staff_type` varchar(32) DEFAULT '' COMMENT '编制类型',
  `hire_date` datetime DEFAULT NULL COMMENT '聘用日期',
  `hire_years` int(10) DEFAULT NULL COMMENT '聘用年限',
  `marjor_info` varchar(512) DEFAULT '' COMMENT '何年毕业于何学校专业',
  `coach_start_date` varchar(32) DEFAULT '' COMMENT '初任教练员时间',
  `l3_appointment_date` varchar(32) DEFAULT '' COMMENT '三级教练员聘任时间',
  `l2_appointment_date` varchar(32) DEFAULT '' COMMENT '二级教练员聘任时间',
  `l1_appointment_date` varchar(32) DEFAULT '' COMMENT '一级教练员聘任时间',
  `ladv_cert_date` varchar(32) DEFAULT '' COMMENT '取得高级教练员资格时间',
  `ladv_appointment_date` varchar(32) DEFAULT '' COMMENT '高级教练员聘任时间',
  `lcn_cert_date` varchar(32) DEFAULT '' COMMENT '取得国家级教练员资格时间',
  `lcn_appointment_date` varchar(32) DEFAULT '' COMMENT '国家级教练员聘任时间',
  `photo_type` varchar(32) DEFAULT '' COMMENT '照片类型',
  `photo_name` varchar(128) DEFAULT '' COMMENT '照片名称',
  `photo_path` varchar(256) DEFAULT '' COMMENT '照片路径',
  `upload_date` datetime DEFAULT NULL COMMENT '照片上传时间',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flat` varchar(1) DEFAULT '' COMMENT '删除标志',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='教练员信息表 ';

