-- ----------------------------
--  Table structure for `tb_gov_cms_news`
-- ----------------------------
DROP TABLE IF EXISTS `tb_gov_cms_news`;
CREATE TABLE `tb_gov_cms_news` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `news_cat` varchar(32) NOT NULL DEFAULT '' COMMENT '新闻类别',
  `news_title` varchar(128) NOT NULL DEFAULT '' COMMENT '标题',
  `news_sub_title` varchar(128) NOT NULL DEFAULT '' COMMENT '副标题',
  `top_status` varchar(32) NOT NULL DEFAULT '' COMMENT '置顶状态',
  `news_order` int(11) DEFAULT NULL COMMENT '显示顺序',
  `enable_status` varchar(32) NOT NULL DEFAULT '' COMMENT '启用状态',
  `news_from` varchar(128) NOT NULL DEFAULT '' COMMENT '来源',
  `publish_date` datetime DEFAULT NULL COMMENT '报道时间',
  `title_image` varchar(256) NOT NULL DEFAULT '' COMMENT '标题图片',
  `news_summary` varchar(512) NOT NULL DEFAULT '' COMMENT '摘要',
  `news_content` text COMMENT '内容',
  `news_link` varchar(256) DEFAULT NULL COMMENT '链接地址',
  `news_hits` int(11) DEFAULT NULL COMMENT '阅览次数',
  `create_by` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) NOT NULL DEFAULT '' COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='公告消息表 ';

-- ----------------------------
--  Table structure for `test_demo`
-- ----------------------------
DROP TABLE IF EXISTS `test_demo`;
CREATE TABLE `test_demo` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人登录名称',
  `create_time` datetime DEFAULT NULL COMMENT '创建日期',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新人登录名称',
  `update_time` datetime DEFAULT NULL COMMENT '更新日期',
  `name` varchar(200) DEFAULT NULL COMMENT '用户名',
  `sex` varchar(32) DEFAULT NULL COMMENT '性别',
  `age` int(32) DEFAULT NULL COMMENT '年龄',
  `descc` varchar(500) DEFAULT NULL COMMENT '描述',
  `user_code` varchar(32) DEFAULT NULL COMMENT '用户编码',
  `file_kk` varchar(500) DEFAULT NULL COMMENT '附件',
  `top_pic` varchar(500) DEFAULT NULL COMMENT '头像',
  `birthdays` datetime DEFAULT NULL COMMENT '生日',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

